import React from "react";
import "./Shop.scss";
import {Container, Row, Col} from 'react-bootstrap';
const Shop = () => {
  return (
    <>
     <Container>
      <Row>
        <Col className='my-5 shop-page'>
          <p>Sidebar</p>
        </Col>
        <Col className='shop-page'>
          
        </Col>
      </Row>
     </Container>
    </>
  );
};

export default Shop;
